  `creationTime` datetime DEFAULT NULL COMMENT '发布时间',
  `popular` int(1) DEFAULT NULL COMMENT '是否热门',
  PRIMARY KEY (`post_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

